import React from 'react';
import './login.css';
export default function Login() {
  return (
    <div className='container' style={{borderRadius:'20px' ,width:'1000px',backgroundColor: '#949EFF'}}>
      <div className="row">
        <div className="col-4" style={{borderRadius:'20px',marginLeft:'2px'}}>
            <p className='p1'>Welcome Users</p>
          <img className='imo' src='login.png'></img>
        </div>
        <div className="col-4" style={{borderRadius:'20px',position:'absolute',backgroundColor:'white',marginLeft:'400px',width:'600px'}}>
         <p className='p2'>Sign up</p>
        </div>
      </div>
    </div>
  );
}
